import React from "react";
import { makeStyles } from "@material-ui/core/styles";
// import { MenuList } from '@material-ui/core';
// import ListItem from "@material-ui/core/ListItem";
import Box from "@material-ui/core/Box";
import Grid from "@material-ui/core/Grid";

const useStyles = makeStyles((theme) => ({
  mainContainer: {
    background: "#233",
    height: "100%",
  },
}));


function Portfolio(props) {

  const classes = useStyles();

  return (
    <Box component="div" className={classes.mainContainer}>

        <Grid className={classes.subMenuGrid}>
                    <button value="All" onClick={props.handalbtns}>All</button>
                    <button value="Mobile" onClick={props.handalbtns}>Mobile</button>
                    <button value="Web" onClick={props.handalbtns}>Web/Window</button>
                    <button value="UX" onClick={props.handalbtns}>UX/UI</button>
                  </Grid>
        <Grid container justify="center">
        {/* Projects */}
           {props.projects.map(projects => {
             return <CardProjects key={projects.id} projects={projects} />

           })}

      </Grid>
    </Box>
  );
};

export default Portfolio;
